import './index.scss'

const NaviBar = () => {
    return (
        <div className="Nav-Bar">
            <div className="Logo">
                <Link className="" to="/">
                    <span>FedeMoya</span>
                </Link>
            </div>
            <nav>
                <ul>

                </ul>
            </nav>
        </div>
    );
}

export default NaviBar;
